# Project Description


How confident are we in the accuracy of the estimated amount of carbon being sequestered by Huntington Wildlife Forest? 

&lt;p style="text-align: justify;"&gt;
  &lt;img src="allometric_idea.jpg" style="float: right; width: 40%; margin-right: 40px;"&gt;
- Allometric equation.
&lt;/p&gt;

&lt;p style="text-align: justify;"&gt;
- Source of errors &lt;/p&gt;

---
# Background

&lt;p style="text-align: justify;"&gt;
  - Estimating uncertainty of allometric biomass equations with incomplete fit error information using a pseudo-data approach: methods. 
&lt;/p&gt;
  &lt;p style="text-align: justify;"&gt;
  &lt;img src="RyFormulas.jpg" style="float: above; width: 60%; margin-left: 20px;"&gt;
  - Estimation of the allometric uncertainty of the forest biomass for the wildlife forest of Huntington. (Patton et al, 2022). 
&lt;/p&gt;


---
# Importance

&lt;p style="text-align: justify;"&gt;
  If we don’t include uncertainty estimates in forest carbon measurements, it’s hard to know how accurate the numbers really are. This makes it difficult to compare carbon levels between different forest areas or to track real changes over time, especially when using allometric equations. &lt;/p&gt;

Map of HWF showing permanent forest inventory plot distribution 
(Continuous Forest Inventory, CFI, n = 288) and forest compartment bound
aries (n = 20). 
&lt;/p&gt;
&lt;p style="text-align: justify;"&gt;
- Is a series of uniformly spaced permanent sample plots that are measured periodically to quantify forest conditions and changes. &lt;/p&gt;
&lt;p style="text-align: justify;"&gt;
- About every 10 years&lt;/p&gt;

---
# Study site

&lt;p style="text-align: justify;"&gt;
A. SAWTIMBER PLOT - A 1/5 acre fixed circular plot on which all hardwoods 11.0 inches in diameter at breast height (dbh) and greater and all softwoods 9.0 inches dbh and greater are measured.&lt;/p&gt; 

&lt;p style="text-align: justify;"&gt;
B. POLE TIMBER PLOT - A 1/10 acre fixed circular plot on which all hardwood trees 5.0 to 10.9 
inches dbh and all softwood trees 5.0 to 8.9 inches dbh are 
measured. &lt;/p&gt;

# Repeat the process n times / 

``` r
#for (j in 1:10000) {

  frameCoeff$MCintercept &lt;- sapply(1:nrow(frameCoeff), function(i) rnorm(1, mean = frameCoeff$intercepto[i], sd = frameCoeff$sd_intercepto[i]))
  frameCoeff$MCslope &lt;- sapply(1:nrow(frameCoeff), function(i) rnorm(1, mean = frameCoeff$pendiente[i], sd = frameCoeff$sd_pendiente[i]))

  
resultados_df &lt;- data.frame(Plot = character(), PloKg_Ha.sum = numeric(), stringsAsFactors = FALSE)
```

# Biomass estimation

``` r
  #1. Sum the biomass of poles an saw in each plot Calculate the total Y_kg by PlotSize and then scale it to hectares // Calcula el total de Y_kg por PlotSize para luego escalarlo a hectáreas
#doBy


SumBioPlots&lt;-summaryBy(Y_kg~Plot+PlotSize, 
          data=CombinationSI, FUN=sum)
#View(SumBioPlots)
```
---
# Convert to Kg/ha

``` r
# 2. Convert to Kg/ha calling plot area to hectarea // Escalación de área de parcela a hectárea
#dplyr

SumBioPlots &lt;- SumBioPlots %&gt;%
  mutate(PloKg_Ha = ifelse(PlotSize == "POLE", ((Y_kg.sum*10000)/202.343), 
                                       ifelse(PlotSize == "SAW", ((Y_kg.sum*10000)/809.372), NA)))
```
---
# Sum Plot across plots

``` r
# 3. Sum PLot (Pole+Saw) across plots 

Sum_A_Plots&lt;-summaryBy(PloKg_Ha~Plot, 
                       data=SumBioPlots, FUN=sum)
head(Sum_A_Plots)
```
